import React from 'react';
import Header from './Header'
import SideBar from './SideBar';
import Content from './Content';
import Footer from './Footer';
import ClientDashboard from './ClientDashboard';

function Admin() {
    return (
        <div class="wrapper">
            <Header />
            <SideBar />
            <Content />
            <Footer />
        </div>
    );
}

export default Admin;
